import React from "react";
import { gsap } from "gsap";
import { ScrollTrigger } from "gsap/ScrollTrigger";
import "./App.css";
import ComputerPlantComponent from "./components/ComputerPlant";

gsap.registerPlugin(ScrollTrigger);

const App = () => {
    return (
        <div className="App">
            <ComputerPlantComponent />
        </div>
    );
};

export default App;
